import React, { useState } from 'react';
import './AddAnimal.css';

function AddAnimal() {
  const [animalName, setAnimalName] = useState('');
  const [animalSpecies, setAnimalSpecies] = useState('');
  const [animalGender, setAnimalGender] = useState('');
  const [animalDOB, setAnimalDOB] = useState('');
  const [isEndangered, setIsEndangered] = useState(''); // Changed to string to store "yes" or "no"
  const [animalOrigin, setAnimalOrigin] = useState('');
  const [lifeStage, setLifeStage] = useState('');

  const handleSubmit = (event) => {
    event.preventDefault();

    console.log('Animal Name:', animalName); // Stored value for Animal Name
    console.log('Animal Species:', animalSpecies); // Stored value for Animal Species
    console.log('Animal Gender:', animalGender); // Stored value for Animal Gender
    console.log('Animal DoB:', animalDOB); // Stored value for Animal DoB
    console.log('Is Animal Endangered:', isEndangered); // Stored value for Is Animal Endangered
    console.log('Animal Origin:', animalOrigin); // Stored value for Animal Origin
    console.log('Animal Life Stage:', lifeStage); // Stored value for Animal Life Stage

    // Implement backend logic to send data inputs to the backend here

    // Clear input fields after submission
    setAnimalName('');
    setAnimalSpecies('');
    setAnimalGender('');
    setAnimalDOB('');
    setIsEndangered('');
    setAnimalOrigin('');
    setLifeStage('');
  };

  return (
    <div className="add-animal-container">
      <h2>Add Animal</h2>
      <form onSubmit={handleSubmit}>
        <div className="form-group">
          <label htmlFor="animalName">Animal Name:</label>
          <input
            type="text"
            id="animalName"
            value={animalName}
            onChange={(e) => setAnimalName(e.target.value)}
            required
          />
        </div>
        <div className="form-group">
          <label htmlFor="animalSpecies">Animal Species:</label>
          <input
            type="text"
            id="animalSpecies"
            value={animalSpecies}
            onChange={(e) => setAnimalSpecies(e.target.value)}
            required
          />
        </div>
        <div className="form-group">
          <label htmlFor="animalGender">Animal Gender:</label>
          <input
            type="text"
            id="animalGender"
            value={animalGender}
            onChange={(e) => setAnimalGender(e.target.value)}
            required
          />
        </div>
        <div className="form-group">
          <label htmlFor="animalDOB">Animal DoB:</label>
          <input
            type="date"
            id="animalDOB"
            value={animalDOB}
            onChange={(e) => setAnimalDOB(e.target.value)}
            required
          />
        </div>
        <div className="form-group">
          <label htmlFor="isEndangered">Is Animal Endangered?</label>
          <select
            id="isEndangered"
            value={isEndangered}
            onChange={(e) => setIsEndangered(e.target.value)}
            required
          >
            <option value="">Select</option>
            <option value="yes">Yes</option>
            <option value="no">No</option>
          </select>
        </div>
        <div className="form-group">
          <label htmlFor="animalOrigin">Animal Origin:</label>
          <input
            type="text"
            id="animalOrigin"
            value={animalOrigin}
            onChange={(e) => setAnimalOrigin(e.target.value)}
            required
          />
        </div>
        <div className="form-group">
          <label htmlFor="lifeStage">Animal Life Stage:</label>
          <input
            type="text"
            id="lifeStage"
            value={lifeStage}
            onChange={(e) => setLifeStage(e.target.value)}
            required
          />
        </div>
        <button type="submit">Submit</button>
      </form>
    </div>
  );
}

export default AddAnimal;
